export default (function(a,b,c,d,e){return {data:{K6ncAV13dD:{data:{id:1831,attributes:{imdbId:"tt0091605",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BZjEyZTdhNDMtMWFkMS00ZmRjLWEyNmEtZDU3MWFkNDEzMDYwXkEyXkFqcGdeQXVyNjc1NTYyMjg@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"7.7\u002F10"},{Source:"Rotten Tomatoes",Value:"74%"},{Source:"Metacritic",Value:"54\u002F100"}],item_lang:{data:{id:2494,attributes:{title:d,plot:"14. century Franciscan monk William of Baskerville and his young novice arrive at a conference to find that several monks have been murdered under mysterious circumstances. To solve the crimes, William must rise up against the Church's authority and fight the shadowy conspiracy of monastery monks using only his intelligence which is considerable.",slug:"the-name-of-the-rose"}}},books:{data:[{id:9296,attributes:{title:d,description:"In 1327, Brother William of Baskerville is sent to investigate charges of heresy against Franciscan monks at a wealthy Italian abbey but finds his mission overshadowed by seven bizarre murders.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=ChlOAwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:true,published:"2014-01-01",publisher:e,subtitle:a}},{id:9297,attributes:{title:"Reflections on The Name of the Rose",description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=X3HyAAAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:c,published:"1985-01-01",publisher:"Harvill Secker",subtitle:a}},{id:9298,attributes:{title:"Postscript to The Name of the Rose",description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=7S9dAAAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b,"Professor of Semiotics Umberto Eco"],firstBook:c,published:"1984-01-01",publisher:"San Diego : Harcourt Brace Jovanovich",subtitle:a}},{id:9299,attributes:{title:"Name of the Rose",description:"It is the year 1327. Franciscans in an Italian abbey are suspected of heresy, but Brother William of Baskerville's investigation is suddenly overshadowed by seven bizarre deaths. Translated by William Weaver. A Helen and Kurt Wolff Book",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=xz87wAKvGcUC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:c,published:"1995-11-01",publisher:e,subtitle:a}},{id:9300,attributes:{title:"Der Name der Rose",description:"Daß er in den Mauern der prächtigen Benediktinerabtei an den Hängen des Apennin das Echo eines verschollenen Lachens hören würde, das hell und klassisch herüberklingt aus der Antike, damit hat der englische Franziskanermönch William von Baskerville nicht gerechnet. Zusammen mit Adson von Melk, seinem etwas tumben, jugendlichen Adlatus, ist er in einer höchst delikaten politischen Mission unterwegs. Doch in den sieben Tagen ihres Aufenthalts werden die beiden mit kriminellen Ereignissen und drastischen Versuchungen konfrontiert: Ein Mönch ist im Schweineblutbottich ertrunken, ein anderer aus dem Fenster gesprungen, ein dritter wird tot im Badehaus gefunden. Aber nicht umsonst stand William lange Jahre im Dienste der heiligen Inquisition. Das Untersuchungsfieber packt ihn. Er sammelt Indizien, entziffert magische Zeichen, entschlüsselt Manuskripte und dringt immer tiefer in ein geheimnisvolles Labyrinth vor, über das der blinde Seher Jorge von Burgos wacht ...",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=M40IAQAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:c,published:"1986-01-01",publisher:a,subtitle:"Roman"}}]}}},meta:{}}},prerenderedAt:1680940956892}}("","Umberto Eco",null,"The Name of the Rose","Houghton Mifflin Harcourt"))